import React from 'react';

function Home() {
    return (
        <div style={{
            minHeight: '100vh',
            background: '#181818',
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            justifyContent: 'center'
        }}>
            <h1 style={{ color: 'white', fontSize: '3rem', marginBottom: '1rem' }}>
                Bem-vindo à Casa de Aposta!
            </h1>
            <p style={{ color: '#ccc', fontSize: '1.2rem', marginBottom: '2rem' }}>
                Faça suas apostas e divirta-se com responsabilidade.
            </p>
            <button style={{
                padding: '1rem 2rem',
                fontSize: '1rem',
                borderRadius: '8px',
                border: 'none',
                background: '#ff9800',
                color: '#fff',
                cursor: 'pointer',
                fontWeight: 'bold'
            }}>
                Começar
            </button>
        </div>
    );
}

export default Home;
